from typing import Union
from .Color import Colors
from .Values import rgb

default_style = 0

def set_default_style(Style : int) -> None :
        """ it's used to change the default values (or) change the value of style to all colors\n
        Ex : set_default_style(3) then it chenge the Italicized style to all coloe_function
        Normal     = 0 \n
        Bold       = 1 \n
        Light      = 2 \n
        Italicized = 3 \n
        UnderLined = 4 \n        
        Blink      = 5 \n
        Return: it's return None Value,it's not return any values just it change the changes in ForeGroundColor file.
        """
        global default_style
        default_style = Style


def h545454( text : str, bg : Union[bool,str] = False, style : int = default_style, rgb : bool = False ) -> str :
        """
        -----------------------------------------------------------------------------------
        The  hex #545454 is the value of Grey.
        -----------------------------------------------------------------------------------
        Return : It will return the 545454 colored text.\n
        -----------------------------------------------------------------------------------
        545454() is a ForeGround Function, if You add BackGround given text you can using bg parameter.\n
        if you want only background use Grey() or Greybg() function.\n
        -----------------------------------------------------------------------------------
        How to use this function :\n
            text = it's need a string input like ['text' (or) "text"] \n
            bg    = it's get the background color of the text Ex: 545454("text",bg='545454') then it's apply the 545454 color background.\n
            rgb   = if rgb is true. that means if any values is given (or) ( non none value or none false ) it returns rgb of 545454\n
                    for example : 545454(" ", rgb=True) then it return the rgb of the value\n
            Style = [
                                Normal     = 0 \n
                                Bold       = 1 \n
                                Light      = 2 \n
                                Italicized = 3 \n
                                UnderLined = 4 \n        
                                Blink      = 5 \n
                        ]
        ------------------------------------------------------------------------------------
            Example :\n
                545454("Hello World", Style = 0 ) = it's return 545454 color text without any style       \n
                545454("Hello World", Style = 1 ) = it's return 545454 color text with bold text          \n
                545454("Hello World", Style = 2 ) = it's return 545454 color text with light text         \n
                545454("Hello World", Style = 3 ) = it's return 545454 color text with Italicized style   \n
                545454("Hello World", Style = 4 ) = it's return 545454 color text with UnderLine          \n
                545454("Hello World", Style = 5 ) = it's return Blinking 545454 color text                \n
        """
        return Colors.fore_ground_color(text, style, 84, 84, 84)
                


